New York University Libraries is a global organization that advances teaching, learning, research, and scholarly inquiry in an environment dedicated to the open exchange of information by:

Building, preserving, interpreting, and providing access to rich and diverse collections;
Fostering the effective use and critical evaluation of information;
Delivering creative and responsive services for diverse user communities.

Our primary responsibility lies with the students and faculty of New York University. The Libraries also welcomes and engages in scholarly, cultural, and artistic interactions with broader communities in our role as stewards of cultural heritage for current and future scholars.

La société publique locale L’Eau des Collines intervient pour exercer :

la gestion du service de collecte et de transport des eaux usées de l’ensemble des communes constituant le CT4 au sein de la Métropole Aix Marseille Provence soit: Aubagne, Auriol, Belcodène, Cadolive, Cuges les Pins, La Bouilladisse, La Destrousse, La Penne sur Huveaune, Peypin, Roquevaire, Saint-Savournin & Saint Zacharie;
la gestion du service d’assainissement non collectif sur tout le périmètre ci-dessus identifié;
La gestion du service de production et de distribution de l’eau potable des Communes: d’Aubagne, La Penne sur Huveaune, Cuges les Pins & Saint Zacharie.
En outre, la société publique locale gère différentes opérations en mandat pour la Métropole Aix Marseille Provence.

A Universidade de Évora é uma das universidades do sistema de ensino superior público português e, por conseguinte, tem por missão:
A produção de conhecimento através da investigação científica e artística, a experimentação e o desenvolvimento tecnológico e humanístico;
A socialização do conhecimento, proporcionando à população estudantil tradicional, bem como à população laboral, a qualificação académica através de cursos de licenciatura, mestrado e doutoramento, de cursos de formação ad hoc  e da formação informal ao longo da vida;
A transmissão do conhecimento à comunidade com vista à inovação e à competitividade empresarial, bem como à modernização dos serviços públicos e ao desenvolvimento social e cultural da comunidade no seu todo.

University of Wisconsin-Madison Libraries provide:

Leadership for the selection, organization, access, and preservation of sources of knowledge in all formats;

Exemplary information services designed to fulfill the needs of a great public research university;

Inspirational environments for collaborative and individual discovery, study, and learning
